"use strict";(self.webpackChunklessons=self.webpackChunklessons||[]).push([[53],{1109:e=>{e.exports=JSON.parse('{"pluginId":"default","version":"current","label":"Next","banner":null,"badge":false,"noIndex":false,"className":"docs-version-current","isLast":true,"docsSidebars":{"lessonsSidebar":[{"type":"link","label":"Welcome","href":"/omd-webapp/learn/","docId":"index"},{"type":"category","label":"Behavior","collapsible":true,"collapsed":true,"items":[{"type":"link","label":"Introduction","href":"/omd-webapp/learn/behavior/intro","docId":"behavior/intro"}],"href":"/omd-webapp/learn/behavior/"}]},"docs":{"behavior/index":{"id":"behavior/index","title":"**Understanding and Nurturing Canine Behavior: A Comprehensive Guide for Dog Parents**","description":"Introduction","sidebar":"lessonsSidebar"},"behavior/intro":{"id":"behavior/intro","title":"Introduction to Understanding Dog Behavior: Decoding Canine Communication and Becoming the Pack Leader","description":"As a devoted dog parent, you cherish the moments spent with your canine companion \u2013 the joyful greetings, wagging tails, and comforting cuddles. But have you ever wondered what your dog is trying to tell you beyond their enthusiastic barks and wagging tails? Understanding your furry friend\'s behavior is the key to fostering a strong and harmonious bond. Dogs communicate through their body language and vocalizations, giving us valuable insights into their emotions and needs. By embracing the role of a confident pack leader, you can provide your dog with the guidance and security they crave. In this article, we delve into the intriguing world of dog behavior, deciphering their communication cues, and mastering the art of leadership for a fulfilling canine-human relationship.","sidebar":"lessonsSidebar"},"index":{"id":"index","title":"**Welcome to OhMyDog Educational Portal!**","description":"Dog with Books","sidebar":"lessonsSidebar"}}}')}}]);